da para su Formulario I-131, Solicitud de Documentos de Viaje, Documentos de Libertad Condicional y Registros de Entrada/Salida, Número de Recibo IOE0921182348.  Le enviaremos su documento por correo a su dirección registrada y lo recibirá en breve. Si se ha mudado desde que presentó su formulario, visite <a href=\\\"https://www.uscis.gov/es/cambiodedireccion\\\" target=\\\"_blank\\\">www.uscis.gov/es/cambiodedireccion</a> para darnos su nueva dirección lo antes posible. Si no ha recibido su documento en 30 días, puede enviar una consulta de caso al USCIS en <a href=\\\"https://egov.uscis.gov/e-request/\\\" target=\\\"_blank\\\">www.uscis.gov/e-request</a>.\",\"empty\":false}}},\"status\":200}',0,1,0),(96,'IOE9310158790','minhminhdinhcuica@gmail.com','2025-07-30 13:27:51','On June 10, 2024, we sent your case, Receipt Number IOE9310158790, to the Department of State for visa processing.  You can find general information on Consular Processing by visiting our website at www.uscis.gov .  The website will provide information on what to do next, who to contact, and how to inform us of any changes in your situation or address.','Case Was Sent To The Department of State','Đã gửi đến Bộ Ngoại giao','2024-06-09','I-130 - Petition for Alien Relative','{\"data\":{\"CaseStatusResponse\":{\"receiptNumber\":\"IOE9310158790\",\"isValid\":true,\"detailsEng\":{\"formNum\":\"I-130\",\"formTitle\":\"Petition for Alien Relative\",\"actionCodeText\":\"Case Was Sent To The Department of State\",\"actionCodeDesc\":\"On June 10, 2024, we sent your case, Receipt Number IOE9310158790, to the Department of State for visa processing.  You can find general information on Consular Processing by visiting our website at www.uscis.gov .  The website will provide information on what to do next, who to contact, and how to inform us of any changes in your situation or address.\",\"empty\":false},\"detailsEs\":{\"formNum\":\"I-130\",\"formTitle\":\"Petición de Familiar Extranjero\",\"actionCodeText\":\